import IHeaders from 'happy-dom/lib/fetch/IHeaders';
import IBody from 'happy-dom/lib/fetch/IBody';
/**
 * Fetch request.
 */
export default interface IRequest extends IBody {
    readonly headers: IHeaders;
    readonly method: string;
    readonly redirect: 'error' | 'follow' | 'manual';
    readonly referrer: string;
    readonly url: string;
    /**
     * Returns a clone.
     *
     * @returns Clone.
     */
    clone(): IRequest;
}
